import React from 'react';
import { Group } from '@visx/group';
import { Bar } from '@visx/shape';
import { scaleBand, scaleLinear } from '@visx/scale';
import { AxisBottom, AxisLeft } from '@visx/axis';
import { Tooltip, useTooltip } from '@visx/tooltip';
import { localPoint } from '@visx/event';
import { people } from './DataList';

// Datenverarbeitung
const getCounts = (data, key) => {
  const counts = {};
  data.forEach(d => {
    if (d[key] !== undefined) {
      counts[d[key]] = (counts[d[key]] || 0) + 1;
    }
  });
  return counts;
};

const ageDistribution = getCounts(people, 'age');
const genderDistribution = getCounts(people, 'gender');
const professionDistribution = getCounts(people, 'profession');
const educationDistribution = getCounts(people, 'education');

const width = 600;
const height = 400;
const margin = { top: 20, right: 20, bottom: 30, left: 40 };

// Chart-Komponente f端r Altersverteilung
const AgeChart = ({ xScale, yScale }) => (
  <svg width={width} height={height}>
    <Group>
      {Object.keys(ageDistribution).map((age, index) => (
        <Bar
          key={index}
          x={xScale(age)}
          y={yScale(ageDistribution[age])}
          width={xScale.bandwidth()}
          height={height - yScale(ageDistribution[age]) - margin.bottom}
          fill="teal"
          onMouseEnter={(event) => {
            const coords = localPoint(event) || { x: 0, y: 0 };
            showTooltip({
              tooltipData: ageDistribution[age],
              tooltipTop: coords.y,
              tooltipLeft: coords.x,
            });
          }}
          onMouseLeave={hideTooltip}
        />
      ))}
      <AxisBottom top={height - margin.bottom} scale={xScale} />
      <AxisLeft scale={yScale} />
    </Group>
  </svg>
);

// Chart-Komponente f端r Geschlechterverteilung
const GenderChart = ({ xScale, yScale }) => (
  <svg width={width} height={height}>
    <Group>
      {Object.keys(genderDistribution).map((gender, index) => (
        <Bar
          key={index}
          x={xScale(gender)}
          y={yScale(genderDistribution[gender])}
          width={xScale.bandwidth()}
          height={height - yScale(genderDistribution[gender]) - margin.bottom}
          fill="orange"
          onMouseEnter={(event) => {
            const coords = localPoint(event) || { x: 0, y: 0 };
            showTooltip({
              tooltipData: genderDistribution[gender],
              tooltipTop: coords.y,
              tooltipLeft: coords.x,
            });
          }}
          onMouseLeave={hideTooltip}
        />
      ))}
      <AxisBottom top={height - margin.bottom} scale={xScale} />
      <AxisLeft scale={yScale} />
    </Group>
  </svg>
);

// Chart-Komponente f端r Berufskategorien
const ProfessionChart = ({ xScale, yScale }) => (
  <svg width={width} height={height}>
    <Group>
      {Object.keys(professionDistribution).map((profession, index) => (
        <Bar
          key={index}
          x={xScale(profession)}
          y={yScale(professionDistribution[profession])}
          width={xScale.bandwidth()}
          height={height - yScale(professionDistribution[profession]) - margin.bottom}
          fill="purple"
          onMouseEnter={(event) => {
            const coords = localPoint(event) || { x: 0, y: 0 };
            showTooltip({
              tooltipData: professionDistribution[profession],
              tooltipTop: coords.y,
              tooltipLeft: coords.x,
            });
          }}
          onMouseLeave={hideTooltip}
        />
      ))}
      <AxisBottom top={height - margin.bottom} scale={xScale} />
      <AxisLeft scale={yScale} />
    </Group>
  </svg>
);

// Chart-Komponente f端r Bildungsniveaus
const EducationChart = ({ xScale, yScale }) => (
  <svg width={width} height={height}>
    <Group>
      {Object.keys(educationDistribution).map((education, index) => (
        <Bar
          key={index}
          x={xScale(education)}
          y={yScale(educationDistribution[education])}
          width={xScale.bandwidth()}
          height={height - yScale(educationDistribution[education]) - margin.bottom}
          fill="green"
          onMouseEnter={(event) => {
            const coords = localPoint(event) || { x: 0, y: 0 };
            showTooltip({
              tooltipData: educationDistribution[education],
              tooltipTop: coords.y,
              tooltipLeft: coords.x,
            });
          }}
          onMouseLeave={hideTooltip}
        />
      ))}
      <AxisBottom top={height - margin.bottom} scale={xScale} />
      <AxisLeft scale={yScale} />
    </Group>
  </svg>
);

const MyCharts2 = () => {
  const { tooltipData, tooltipLeft, tooltipTop, showTooltip, hideTooltip } = useTooltip();

  // Skalierungen
  const xScaleAge = scaleBand({
    domain: Object.keys(ageDistribution),
    range: [margin.left, width - margin.right],
    padding: 0.4,
  });
  const yScaleAge = scaleLinear({
    domain: [0, Math.max(...Object.values(ageDistribution))],
    range: [height - margin.bottom, margin.top],
  });

  const xScaleGender = scaleBand({
    domain: Object.keys(genderDistribution),
    range: [margin.left, width - margin.right],
    padding: 0.4,
  });
  const yScaleGender = scaleLinear({
    domain: [0, Math.max(...Object.values(genderDistribution))],
    range: [height - margin.bottom, margin.top],
  });

  const xScaleProfession = scaleBand({
    domain: Object.keys(professionDistribution),
    range: [margin.left, width - margin.right],
    padding: 0.4,
  });
  const yScaleProfession = scaleLinear({
    domain: [0, Math.max(...Object.values(professionDistribution))],
    range: [height - margin.bottom, margin.top],
  });

  const xScaleEducation = scaleBand({
    domain: Object.keys(educationDistribution),
    range: [margin.left, width - margin.right],
    padding: 0.4,
  });
  const yScaleEducation = scaleLinear({
    domain: [0, Math.max(...Object.values(educationDistribution))],
    range: [height - margin.bottom, margin.top],
  });

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
      <div style={{ width, height, marginBottom: 40 }}>
        <h2>Altersverteilung</h2>
        <AgeChart xScale={xScaleAge} yScale={yScaleAge} />
      </div>

      <div style={{ width, height, marginBottom: 40 }}>
        <h2>Geschlechterverteilung</h2>
        <GenderChart xScale={xScaleGender} yScale={yScaleGender} />
      </div>

      <div style={{ width, height, marginBottom: 40 }}>
        <h2>Berufskategorien</h2>
        <ProfessionChart xScale={xScaleProfession} yScale={yScaleProfession} />
      </div>

      <div style={{ width, height }}>
        <h2>Bildungsniveaus</h2>
        <EducationChart xScale={xScaleEducation} yScale={yScaleEducation} />
      </div>

      {tooltipData !== undefined && (
        <Tooltip top={tooltipTop} left={tooltipLeft}>
          <div>{`Anzahl: ${tooltipData}`}</div>
        </Tooltip>
      )}
    </div>
  );
};

export default MyCharts2;
